import{_ as i,o as s,c as d,b as n,d as a,e,a as r,r as h}from"./app.1402cf24.js";var l="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/01.jpg",u="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/02.jpg",o="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/03.jpg",m="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/04.jpg",c="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/05.jpg",g="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/06.jpg",p="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/07.jpg",k="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/08.jpg",b="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/09.jpg",_="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/10.jpg",f="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/11.jpg",v="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/12.jpg",w="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/13.jpg",D="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/14.jpg",z="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/15.jpg",A="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/16.jpg",S="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/17.jpg",P="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/18.jpg",B="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/19.jpg",E="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/20.jpg",T="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/21.jpg",F="/aktivitaeten/160-80m-aktivit\xE4t-2025-01-11/22.jpg";const H={},L=n("h1",{id:"thorls-park-hamburg",tabindex:"-1"},[n("a",{class:"header-anchor",href:"#thorls-park-hamburg","aria-hidden":"true"},"#"),e(" Th\xF6rls Park Hamburg")],-1),N=e("In Hamburg hat es Tobias (DC1TC), Peter (DL6PL) und Harm (DK4HAA) in die Dunkelheit und K\xE4lte gezogen. Um 16:30 Uhr Lokalzeit haben wir uns im "),j={href:"https://pota.app/#/park/DE-0261",target:"_blank",rel:"noopener noreferrer"},K=e("Th\xF6rls Park, POTA-Referenz DE-0261"),C=e(", getroffen."),M=e("Unser Plan: wir bauen uns einen Dipol f\xFCr 160m! Baum zu Baum, in der Mitte ein Mast f\xFCr den Speisepunkt. Schnell mit einem langen Ma\xDFband die Abst\xE4nde zwischen den B\xE4umen gepr\xFCft. Passt! Sogar der Speisepunkt lag an unserer g\xE4ngigen POTA-Stelle. Die Antenne verlief sogar parallel zum den Trails "),O={href:"https://pota.app/#/park/DE-0558",target:"_blank",rel:"noopener noreferrer"},R=e("DE-0558"),W=e(" und "),x={href:"https://pota.app/#/park/DE-0622",target:"_blank",rel:"noopener noreferrer"},V=e("DE-0622"),U=e("! Also eine 3-fer Aktivierung. Pi mal Daumen den Velocity Factor ber\xFCcksichtigt und schon rollten Meter nach Meter Antennenlitze von unseren beiden 100m Spulen. 2x 38m sollten es werden. Wir haben damit gerechnet, dass wir noch einiges an Abstimmarbeiten machen m\xFCssten. Als die Antenne hing und das Ergebnis auf dem Rigexpert Stick sichtbar wurde, war die Freude gro\xDF: unsere Antenne hatte beim ersten Versuch eine Punktlandung auf dem 160m-Band gemacht!"),Q=r('<p>Also schnell ran an das FT-891 und zur Sicherheit noch einmal den Bandplan gepr\xFCft: wo genau ist eigentlich was auf 160m?</p><p>In der Zwischenzeit hatten sich zwei weitere Drau\xDFenfunker eingefunden, die uns einen Besuch abstatten wollten: Ben (DL2XU) mit Frau und Kevin (DN9KC) mit seinem Hund. Vielen Dank, dass ihr euch bei der K\xE4lte aufgemacht habt, um das Spektakel aus erster Reihe zu betrachten!</p><p>Nach dem Einschalten des Funkger\xE4ts herrschte zun\xE4chst etwas Ern\xFCchterung: S9 QRM. Wir vermuten, es liegt im Th\xF6rls Park an der U-Bahn, die nur wenige Meter neben unserem Spot unterirdisch kreuzt.</p><p>Trotzdem konnten wir einige Stationen laut und deutlich auf 160m h\xF6ren! In die laufenden und lang anhaltenden QSOs haben wir uns allerdings nicht reingemeldet. Andere Drau\xDFenfunker konnten wir zu der Zeit noch nicht h\xF6ren.</p><p>Also Bandwechsel auf 80m. Mit Hilfe des Tuners war die Antenne einigerma\xDFen brauchbar. SWR 3:1 am TRX. Nunja. Besser als nichts. Auf pota.app fanden wir sie dann auch: die anderen Drau\xDFenfunker auf dem 80m-Band!</p><p><img src="'+l+'" alt="1"><img src="'+u+'" alt="2"><img src="'+o+'" alt="3"><img src="'+m+'" alt="4"><img src="'+c+'" alt="5"></p><p>Nach und nach kamen die QSOs zusammen. Das Band war voll und die Signale schwankten teilweise sehr stark. Trotzdem haben immer beide Seiten alles gegeben, um das QSO ins Log zu bekommen! Die Freude \xFCber weitere DF2DF-Kontakte war bei vielen Stationen h\xF6rbar. Je weiter der Abend fortschritt, wurden die Verbindungen auf 80m lauter und klarer. Die Freude stieg: sollte eine reine 160/80m Aktivierung gelingen? Langsam machte sich aber auch die K\xE4lte bemerkbar. Wir wechselten noch einmal auf 160m und brachten weitere QSOs ins Log.</p><p>Nach knapp 3 Stunden im Park beschlossen wir, dass es an der Zeit war, abzubauen. Zwischenzeitlich war die Wiese weiter gefroren und auf unserem Material war eine d\xFCnne Frostschicht. Also schnell mit kalten Fingern die Litze aus den B\xE4umen, den Mast zusammenschieben (gar nicht so einfach!) und alles aufrollen und ab damit in die Rucks\xE4cke.</p><p>Wie bedanken uns ganz herzlich bei allen, die heute drau\xDFen waren und diese tolle Aktion erst m\xF6glich gemacht haben. Und nat\xFCrlich ein gro\xDFes Dankesch\xF6n an Dirk (DO1EDK) und Nils (DB6NL), die mit ihrer Ank\xFCndigung der Low-Band-Aktivit\xE4t den Stein (Felsen?) ins Rollen gebracht haben! Einfach mal machen!</p><p>Tobias (DC1TC), Peter (DL6PL) und Harm (DK4HAA)</p><h1 id="halde-beckstein" tabindex="-1"><a class="header-anchor" href="#halde-beckstein" aria-hidden="true">#</a> Halde Beckstein</h1>',11),G=e("Da das Wetter blieb trocken angesagt und so sind Rosi (DG5YL), Dirk (DO1EDK) und Nils (DB6NL) bei den Plan geblieben die Aktivierung auf der "),I={href:"https://pota.app/#/park/DE-0327",target:"_blank",rel:"noopener noreferrer"},Z=e("Halde Beckstein DE-0327"),X=e(" zu machen. F\xFCr Dirk und Nils war das eine pers\xF6nliche Erstaktivierung. Auf der Halde steht eine riesige Stahlkonstruktion, "),y={href:"https://de.wikipedia.org/wiki/Tetraeder_(Bottrop)",target:"_blank",rel:"noopener noreferrer"},J=e("dass Tretraeder"),q=e(" welches im Ruhrgebiet eine markante Landmarke darstellt. Nach Dirks Plan wollten wir da einfach den Draht von deiner der Aussichtsplattformen zum Boden abspannen."),Y=r('<p>Um 16:45 Uhr K\xFCchenzeit war Treffen am Fu\xDF der Halde und die 90hm waren mit der Ausr\xFCstung schnell gemacht. Oben waren schon Christiane (DN9CH) und Gerd (DL2EGS), die schon ihren Teil aufgebaut hatten. Tetraeder (Bottrop) Das Haldenereignis Emscherblick, kurz Tetraeder, ist eine begehbare Aussichtsterrasse in Form einer dreiseitigen Pyramide auf der Halde Beckstra\xDFe im Bottroper Stadtteil Batenbrock. Die Stahlkonstruktion mit einer Seitenl\xE4nge von 60 m ruht auf vier 9 m hohen Betonpfeilern und befindet sich auf der Kuppe der ca. 120 m \xFCber NN hohen Halde an der B... Tetraeder (Bottrop)</p><p><img src="'+g+'" alt="6"><img src="'+p+'" alt="7"></p><p>W\xE4hrend der Aufbaus kam mit Handfunkger\xE4ten auf 70cm und 2m schon das erste P2P und Log. Michael (DM1CHA) war mit kleiner UKW-Ausr\xFCstung (TRX mit Wanderset von Anjo) auf der Halde Rheinpreu\xDFen (DE-0666).</p><p><img src="'+k+'" alt="8"></p><p>Der Draht war schnell als Interpretation eines Slopers abgespannt und beim Anschluss des FT-891 viel leider auf, dass der Tuner wohl ausgeb\xFCxt ist und bei den Temperaturen lieber im Shack bleiben wollte wollte. Wer will es ihm verdenken. Also musste der Anschluss nur mit Mantelwellensperre erfolgen. Die 40m Draht waren aber erstaunlich resonant (immerhin besser als 1:3), so dass der Aktivierung nichts im Wege stand. Parallal hatte Nils noch einen IC-705 mit einer HF-P1 aufgebaut, um noch einwenig FT8 auf 20m und 40m laufen zu lassen.</p><p>Die Aktivierung war ein voller Erfolg. Auf 80m musste w\xE4hrend der ersten QSOs die QRG noch mehrfach gewechselt werden, da starke Nachbarstationen in der Luft waren, aber die J\xE4ger blieben zum Gl\xFCck ziemlich aufmerksam. Die Aktion wurde vorab in funkbegeisterten Kreisen angek\xFCndigt, so dass u.a. auch andere Stationen in Parks aktiv waren. Es konnten P2Ps mit Hamburg, Kempten, Celle, Duisburg, Bottrop auf 80m und z.T. auch auf 160m ins Log geholt werden. Viele DF2DF-Kontakte kamen so ins Log. Die Stimmung an der Station war sehr ausgelassen und die QSO-Partner und J\xE4ger waren ziemlich geduldig, da z.T. 4 OPs an der Station gearbeitet haben. Zum Hochhalten der Stimmung gab es zwischendurch Kaffee und selbstgebackene Kekse. Ein leichtes aufkommenden Schneergeriesel wurde einfach ignoriert. Gegen 19:30 wurde die Station langsam abgebaut, da alle OPs dann doch schon gut durchgefroren waren.</p><p><img src="'+b+'" alt="9"><img src="'+_+'" alt="10"><img src="'+f+'" alt="11"><img src="'+v+'" alt="12"></p><p>Zum Abschluss der Aktion kam noch Carsten (DC8CH) dazu, der in Duisburg mit Philipp (DO8PHK) den Landschaftspark Duisburd-Nord (DE-0146) aktiviert hatte. Zur Nachbesprechung und zum Feiern des Erfolges wurde des n\xE4chste Restaurant mit den zwei goldenen Halbwellen angefahren. Die Stimmung war ausgelassen und hat sehr viel Spass gemacht. Es ruft definitiv nach einer Wiederholung.</p><p><img src="'+w+'" alt="13"></p><h1 id="landschaftspark-duisburg-nord" tabindex="-1"><a class="header-anchor" href="#landschaftspark-duisburg-nord" aria-hidden="true">#</a> Landschaftspark Duisburg-Nord</h1>',10),$=e("Auch vom "),ee={href:"https://pota.app/#/park/DE-0146",target:"_blank",rel:"noopener noreferrer"},ne=e("Landschaftspark Duisburg-Nord, DE-0146"),te=e(" beteiligten sich zwei Drau\xDFenfunker am 80/160m-Event. Carsten (DC8CH) und Philipp (DO8PHK) spannten einen Draht mit 36m L\xE4nge vom Portalkran \xFCber den Parkplatz, um dem Event beizuwohnen. Bevor dieser Draht zum Einsatz kommen sollte, konnten Carsten und Philipp eine Verbindung zur Halde Rheinpreu\xDFen (DE-0666) auf 70cm herstellen. Bei den letzten Reststrahlen Sonnenschein, die unter der dicken Wolkendecke nur ged\xE4mpft hervortraten, waren sogar noch einige DX-Verbindungen nach NA in guter Qualit\xE4t auf dem 15m-Band m\xF6glich. Bei Einbruch der Dunkelheit wurde schlie\xDFlich auf das 80m-Band gewechselt und es konnten, nach angemessener Wartezeit im Pileup, auch mit DF2DF-Kontakte mit Hamburg, Celle und nat\xFCrlich der Halde Beckstra\xDFe im Log verewigt werden. Fehlte noch das 160m-Band, das sich partout nicht resonant zeigen wollte. Als beim Abbau nach 2 Stunden Funkbetrieb unter eisigen Temperaturen das Kabel mit dem Gegengewicht bereits (oder besser: nach wie vor) fein s\xE4uberlich aufgerollt war, wurde den beiden OPs schnell klar, warum es heute auf 160m keine Rosen gab."),ae=n("p",null,[n("img",{src:D,alt:"14"}),n("img",{src:z,alt:"15"})],-1),re=n("h1",{id:"obere-allerniederung-celle",tabindex:"-1"},[n("a",{class:"header-anchor",href:"#obere-allerniederung-celle","aria-hidden":"true"},"#"),e(" Obere Allerniederung Celle")],-1),ie=e("Punkt 16 Uhr versammelten sich Martin DK9CA, Steffen DO3OI und als \xDCberraschungsgast DL1ABR, der charmante Franz, in der frostigen Wildnis von POTA Park "),se={href:"https://pota.app/#/park/DE-0534",target:"_blank",rel:"noopener noreferrer"},de=e("DE-0534"),he=e(". Das Team brachte 46 Meter Draht nebst einer Spule mit stolzen 200 Mikrohenry zum Einsatz \u2013 gespannt zwischen zwei zehn Meter hohen Masten. Um abendliche Stolperopfer zu vermeiden, kamen findige Fahrradleuchten als \u201EGefahrenabschreckung\u201C zum Einsatz \u2013 ein innovativer Sicherheitsstandard der Extraklasse."),le=r('<p>Das leibliche Wohl durfte nat\xFCrlich nicht zu kurz kommen: Rahmen-Nudeln blubberten auf dem Campingkocher, w\xE4hrend hei\xDFer Tee die Finger und Geister erw\xE4rmte. Trotz aller Vorsorge hatte der Frost einen Trumpf: Das Mikrofon-Spiralkabel versteifte sich so sehr, dass es den Sprechern ein unfreiwillig inniges Verh\xE4ltnis zum Funkger\xE4t bescherte.</p><p>Doch das hinderte niemanden an erfolgreichen Funkkontakten: Auf 80m und 160m ging es hei\xDF her \u2013 Park-to-Park und Draussenfunker 2 Draussenfunker QSOs wurden gef\xFChrt.</p><p>Wir waren uns einig: gerne wieder. Nicht schlimm, wenn\u2019s dann etwas w\xE4rmer w\xE4re. Deshalb beenden wir den kurzen R\xFCckblick mit einem Ausblick:</p><blockquote><p>\u201EBei K\xE4lte funken, das macht Mut, doch wenn die Sonne scheinen tut, stehn wir erneut mit Draht und Mast, denn Draussenfunker sein macht Spa\xDF!\u201C</p></blockquote><p><img src="'+A+'" alt="16"><img src="'+S+'" alt="17"><img src="'+P+'" alt="18"><img src="'+B+'" alt="19"><img src="'+E+'" alt="20"><img src="'+T+'" alt="21"><img src="'+F+'" alt="22"></p>',5);function ue(oe,me){const t=h("ExternalLinkIcon");return s(),d("div",null,[L,n("p",null,[N,n("a",j,[K,a(t)]),C]),n("p",null,[M,n("a",O,[R,a(t)]),W,n("a",x,[V,a(t)]),U]),Q,n("p",null,[G,n("a",I,[Z,a(t)]),X,n("a",y,[J,a(t)]),q]),Y,n("p",null,[$,n("a",ee,[ne,a(t)]),te]),ae,re,n("p",null,[ie,n("a",se,[de,a(t)]),he]),le])}var ge=i(H,[["render",ue],["__file","2025-01-11-160-80m-aktivit\xE4t.html.vue"]]);export{ge as default};
